            <div className="div_txt">
                <h1>{product.name}</h1>
                <div><h3>{product.category}</h3></div>
                <i class="fa fa-heart-o" style="font-size:24px"></i>
 <p><i className="fa-duotone fa-face-smile-hearts"></i>wish list</p>
                <p><i className="fa-duotone fa-credit-card-front"></i> card</p>
            </div>
        </div>
    )
}

